import styled, { css } from 'styled-components'

const Text = styled.p`
    font-size: 16px;
    font-weight: 300;
    margin-bottom: 0;
    line-height: 30px;
    color: ${props => props.grey && css`
      color: #777
    `}
`;

export default Text
